const openMainSidebar = () => {
    document.getElementById("mainsidebar").style.left = "0";
}
const closeMainSidebar = () => {
    document.getElementById("mainsidebar").style.left = "-100%";
}

//toggle between hiding and showing the dropdown content
function myFunction(value) {
    let allDropDown = document.getElementsByClassName("myDropdown");
    for (var i = 0; i < allDropDown.length; i++) {
        if (document.getElementById(allDropDown.item(i).getAttribute('id')).classList.contains("show")) {
            document.getElementById(allDropDown.item(i).getAttribute('id')).classList.toggle("show");
        } else if (value == allDropDown.item(i).getAttribute("data-dropdown")) {
            document.getElementById(value).classList.toggle("show");
            document.getElementById("myInput-" + value).focus();
        }
    }
}

function dropdownChosen(value, dropdown) {
    let allDropDown = document.getElementsByClassName("myDropdown");
    for (var i = 0; i < allDropDown.length; i++) {
        if (document.getElementById(allDropDown.item(i).getAttribute('id')).classList.contains("show")) {
            document.getElementById(allDropDown.item(i).getAttribute('id')).classList.toggle("show");
        }
    }
    document.getElementById("chosen-" + dropdown).innerHTML = value;
    document.getElementById("maininput-" + dropdown).value = value;
}

function filterFunction(dropdown) {
    var input, filter, ul, li, a, i;
    input = document.getElementById("myInput-" + dropdown);
    filter = input.value.toUpperCase();
    div = document.getElementById(dropdown);
    a = div.getElementsByTagName("a");
    for (i = 0; i < a.length; i++) {
        txtValue = a[i].textContent || a[i].innerText;
        if (txtValue.toUpperCase().indexOf(filter) > -1) {
            a[i].style.display = "";
        } else {
            a[i].style.display = "none";
        }
    }
}

// collapse sidebar
function sidebarCollapse(value) {
    let allSideCollapse = document.getElementsByClassName("sidebar-collapse");
    for (var i = 0; i < allSideCollapse.length; i++) {
        if (document.getElementById(allSideCollapse.item(i).getAttribute('id')).classList.contains("sidebar-show")) {
            document.getElementById(allSideCollapse.item(i).getAttribute('id')).classList.toggle("sidebar-show");
        } else if (value == allSideCollapse.item(i).getAttribute("id")) {
            document.getElementById(value).classList.toggle("sidebar-show");
        }
    }
}

